import React from 'react';

export default function Dashbord() {
  return (
    <div>
        <h1>Dashboard</h1>
        <p>Welcome to your dashboard.</p>
        <p>Here you can access various features and information related to your business.</p>
        <form action="" className="adminlog">
            <label htmlFor="username">Username:</label>
            <input type="text" id="username" name="username" required />
            <label>Image:</label>
            <input type='image' id="password" name="password" required />
        </form>
    </div>
  );
}
